const fetchReducer = (state, action) => {
    switch(action.type){
      case 'GET_LIST':
        return {...state, data: action.payload}
      case 'GET_DENTIST':
        return {...state, dentist: action.payload}
      default: 
        throw new Error();
    }
  }
